内容 40ml
※サイドミラー専用
※塗布後は絶対に拭かないでください。
※完全に乾燥するまで水に濡れないようにしてください。

目に見えないナノレベルの超微細な連続突起により、
雨滴がミラーに留まることができない、超撥水性能を実現。<br>
さらに、極限まで薄く均等で平滑な被膜を形成するので、水や汚れのひっかかりを大幅に軽減。<br>
<br>
これにより、超撥水性、耐久性が飛躍的に向上。<br>
従来のポンプ式ではなく、エアゾール式なので
ムラのない均一な被膜が短時間で簡単に施工できます。<style type="text/css">
