洗車用拭き取り材として長年ご愛顧頂いている、吸水性、拭き取り性に優れた人工合成セームの代名詞、アイオン　「プラスセーヌ」<br>
・車の拭取り材の代表商品として、50年以上ご愛顧頂いている、吸水性、拭き取り性に優れたスポンジクロスです。<br>
・吸水時には極めてソフトな風合いをもち、また塗装面への摩擦抵抗を減らすエンボス(凹凸）加工を施しているので、車に優しく、しかも拭取り作業が楽に出来ます。<br>
・PVAスポンジの間に、ポリエステル繊維の芯材を入れた三層構造の為、引っ張っても破れにくく、耐久性に優れています。<br><br>
素材：PVAスポンジ／芯材：ポリエステル<br><br>
品番(サイズ):寸法(数量)<br>
・L301(Lサイズ)：約690×430mm(1枚/ケース)<br>
・R302(Rサイズ)：約430×325mm(1枚/ケース)<br>
・S303(Sサイズ)：約430×225mm(1枚/ケース) <br><br>
色：各サイズ　ブルー(B)、ピンク(P)、イエロー(Y)の3色 <br><br>
